import React from "react";

function Career() {
  return (
    <div>
      <img
        src="assets/images/bgcareer.jpg"
        alt=""
        style={{ background: "linear-gradient(#e66465, #9198e5)" }}
      />
    </div>
  );
}

export default Career;
